import React from 'react';
import './App.css';
import NavBar from './components/NavBar';
import SeeProjects from './components/SeeProjects';

function App() {
  return (
    <div className="App">
      <NavBar />
      <main>
        <div className="projects-div">
          <SeeProjects />
        </div>
      </main>
    </div>
  );
}

export default App;
